26.body:
exposes GraphQL API with following schema Scalars BigDecimal represents signed fractional values with arbitrary precision. DateTime represents date and time in yyyy-mm-ddThh:mm:ss format NaturalNumber represents integer including zero Status represents transaction status one of queued, committed or rollbacked Types Virtual Account type account { tenant: tenant name: String! format: String! currency: String! balance: BigDecimal!
} A Tenant type tenant { name: String!
} Single transfer from Virtual Account A to Virtual Account B type transfer { tenant: tenant transaction: String! transfer: String! status: Status! credit: account debit: account currency: String! amount: BigDecimal! valueDate: DateTime!
} Queries tenant( tenant: String!
): tenant tenants( limit: NaturalNumber!, offset: NaturalNumber!
): [tenant!]! account( tenant: String!, name: String!
): account accounts( tenant: String!, currency: String, format: String, limit: NaturalNumber!, offset: NaturalNumber!
): [account!]! transfers( tenant: String!, currency: String, status: Status, amount_lt: BigDecimal, amount_lte: BigDecimal, amount_gt: BigDecimal, amount_gte: BigDecimal, valueDate_lt: DateTime, valueDate_lte: DateTime, valueDate_gt: DateTime, valueDate_gte: DateTime, limit: NaturalNumber!, offset: NaturalNumber!
): [transfer!]! there are no mutations implemented, to mutate data one must use REST APIs of vault or ledger .
